import React from 'react'
import "./Sidebar.scss"
import DashboardCustomizeRoundedIcon from '@mui/icons-material/DashboardCustomizeRounded';
import GridViewRoundedIcon from '@mui/icons-material/GridViewRounded';
import ViewInArIcon from '@mui/icons-material/ViewInAr';
import PortraitOutlinedIcon from '@mui/icons-material/PortraitOutlined';
import ContactSupportOutlinedIcon from '@mui/icons-material/ContactSupportOutlined';
import DownloadingIcon from '@mui/icons-material/Downloading';
import TrendingUpIcon from '@mui/icons-material/TrendingUp';

function Sidebar() {
  return (
    <div className='sidebar'>
    <div className='top'><DashboardCustomizeRoundedIcon className='icon'/><span className='logo'>Dashboard</span></div>
    <div className='center'>
    <ul>
    <GridViewRoundedIcon className='icon'/><li>Dashboard</li>
    <ViewInArIcon className='icon'/><li>Product</li>
    <PortraitOutlinedIcon className='icon'/><li>Customers</li>
    <DownloadingIcon className='icon'/><li>Income</li>
    <TrendingUpIcon className='icon'/><li><span>Promote</span></li>
    <ContactSupportOutlinedIcon className='icon'/><li><span>Help</span></li>
    </ul></div>
    <div className='bottom'></div>





    </div>
  )
}

export default Sidebar
